IF OBJECT_ID('dbo.proc_transform_284', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_284;
GO
CREATE PROCEDURE dbo.proc_transform_284
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_284
    SET payload = LEFT(payload, 1000) + N'|V4-284|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_284;
END
GO
IF OBJECT_ID('dbo.audit_v4_284', 'U') IS NULL
